import React, { Component } from './node_modules/react';


class URL extends Component {

    
    constructor (url) {
         this.url = 'https://teamrocket-reportes-backend.herokuapp.com/ApiController/';
    }
  // Getter
  get   url  ()   {  
      return this.url();
    }
   

}

export default URL;
